import React from 'react';

const Footer = () => {
  const footerStyle = {
    backgroundColor: '#1E1E1E',
    color: '#FFFFFF',
    textAlign: 'center',
    padding: '1rem',
    borderTop: '1px solid #333',
    marginTop: 'auto'
  };

  const currentYear = new Date().getFullYear();

  return (
    <footer style={footerStyle}>
      <p>&copy; {currentYear} Sistema de Alunos. Todos os direitos reservados.</p>
    </footer>
  );
};

export default Footer;
